/** Maze Solving
 * 
 *  @author Jake Peterson
 *  
 *  Program uses a Tramaux Traversal Backtracking Algorithm to solve a 2D maze. The algorithm marks the 
 *  current cell as visited and recursively explores all four directions (right, down, left, up) for a 
 *  path to the exit. If a path is found, it returns true; otherwise, it backtracks and tries another direction.
 *  The console will output the unsolved maze, then the solved maze. If no solution to the maze exists; "No solution found"
 *  is printed to the console.
 * 
 *  The following mazes:
 *      Maze1 and Maze2 <- Mazes for testing average case
 *      Maze3 <- Maze for testing the worst case (no exit exists, loops occur, traverses large amount of maze)
 *      Maze4 <- Maze for testing the best case (straight line through maze, no loops or crossroads)
 *      Maze5 <- Maze for testing how efficiently can a solution for a larger maze be found
 *      Maze6 <- Maze for testing how efficiently can a solution for an even larger maze be found
 * 
 *  For organizational purposes, all header files used are listed in a single "headers.h" header file.
 */
